(157, 78, 'More Information', 1, NULL, '2020-09-22 22:20:05', '2020-09-22 22:20:05', 0, 'poster'),
(159, 72, 'Abstract', 1, '<p>Area-level factors are understudied in systemic lupus erythematosus (SLE). We used data from the Black Women\'s Experiences Living with Lupus (BeWELL) Study to identify unique latent profiles of census tract characteristics and examine associations with risk factors for heightened SLE activity among 438 Black women living in 257 metropolitan Atlanta, GA census tracts. Structural equation models indicate racially segregated, predominately Black, and mid-to-low SES census tracts are risk factors for elevated disease activity through increased perceived neighborhood disorder and depression. Structural racism and racial residential segregation shape physical and social neighborhood factors which may in part drive inequitable SLE outcomes for Black women. Interventions which address structural racism, including racial residential segregation, concentrated poverty, and neighborhood disorder, may reduce racial SLE disparities and promote health&nbsp;equity.</p><p><br></p><p>Highlights: </p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Latent profile analysis identified four unique census tract profiles in the sample</p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Profile associations with lupus activity differed by tract SES &amp; racial composition</p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Perceived neighborhood disorder and depression may mediate this relationship</p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Structural racism and neighborhood factors may promote racial disparities in lupus</p>', '2020-09-23 00:52:16', '2020-09-23 00:58:46', 0, 'poster'),
