(170, 72, 'Add Health New Data Releases (2020)', 1, '<p><strong><u>Add Health New Data Releases</u></strong></p><p><br></p><p>Add Health is accepting requests for the Wave V data from users with current restricted-use data contracts. To apply, renew, or access the Add Health restricted data visit the <a href=\"https://data.cpc.unc.edu/projects/2/view\" rel=\"noopener noreferrer\" target=\"_blank\">CPC Data Portal</a>. </p><p>Public-use data for Wave V will be available in December 2020.&nbsp;</p><p><br></p><p>Add Health is excited to announce the release of the following new data files, available for Add Health restricted-use data&nbsp;contract researchers.</p><p><br></p><p class=\"ql-indent-1\"><strong>Wave V Demographics – Home Exam</strong></p><p class=\"ql-indent-1\">These files contain various demographic variables in regards to the Wave V home exam, including the date of the home exam, number of days between the Wave V survey and the home exam. It also includes the home exam completion status, as well as the respondent’s age, biological sex, pregnancy status, medication use and blood draw status.</p><p class=\"ql-indent-1\"><br></p><p class=\"ql-indent-1\"><strong>Wave V Glucose Homeostasis</strong></p><p class=\"ql-indent-1\">This file contains assay results of glucose and hemoglobin A1c (HbA1c) based on venous blood collected via phlebotomy at the Wave V home exam. There are classifications for fasting glucose and non-fasting glucose, as well as an HbA1C classification. Other variables included are flags based on a self-reported diabetes medical history, anti-diabetic medication use, and a diabetes joint classification variable.</p><p class=\"ql-indent-1\"><br></p><p class=\"ql-indent-1\"><strong>Wave V Lipids</strong></p><p class=\"ql-indent-1\">The Wave V lipids file contains constructed measures designed to facilitate analysis and interpretation of lipids results based on venous blood collected via phlebotomy at the Wave V home exam. In addition to the lipid assay results, there are classifications according to both the NCEP/ATP III and AHA/ACC guidelines, a flag for antihyperlipidemic medication use, and two hyperlipidemia joint classification variables.</p><p class=\"ql-indent-1\"><br></p><p class=\"ql-indent-1\"><strong>Wave V Renal Function</strong></p><p class=\"ql-indent-1\">This file contains constructed measures designed to facilitate analysis and interpretation of renal function based on venous blood collected via phlebotomy at the Wave V home exam. Assay results for creatinine and cystatin-c are available, as well as three different estimations of the glomerular filtration rate (GFR) using either the creatinine concentration, the cystatin C concentration or both concentrations. Classifications according to both clinical and KDIGO guidelines are available as well.</p><p class=\"ql-indent-1\"><br></p><p class=\"ql-indent-1\"><strong>Wave V Inflammation and Immune Function</strong></p><p class=\"ql-indent-1\">These files include constructed measures designed to facilitate analysis and interpretation of inflammation and immune function based on venous blood collected via phlebotomy at the Wave V home exam. In addition to the assay results for high sensitivity C-reactive protein (hsCRP), there is an AHA/CDC classification, counts of subclinical symptoms and common infectious or inflammatory diseases, and various anti-inflammatory medication use flags.</p><p class=\"ql-indent-1\"><br></p><p class=\"ql-indent-1\"><strong>Wave V Biomarker Weight</strong></p><p class=\"ql-indent-1\">This file contains the Wave V biomarker sample weight.</p><p class=\"ql-indent-1\"><br></p><p class=\"ql-indent-1\"><strong>Wave V Sample 2B</strong></p><p class=\"ql-indent-1\">Sample S2B is part of the Wave V survey. S2B was administered 2 June 2017-8 July 2018. While most variables were released in December 2019 as Wave V data, two sections were not. These specifically S2B cases are a representative sample (asked of everyone in the sample). Web survey content for the other samples (1, 2A, 3) were edited mid-data collection and not all respondents in each sample had the opportunity to answer the questions.</p><p class=\"ql-indent-1\"><br></p><p class=\"ql-indent-1\"><strong>Wave V Constructed Age</strong></p><p class=\"ql-indent-1\">The Wave V survey did not ask respondent age though it is possible to calculate age using interview date and date of birth. For deductive disclosure reasons complete interview dates and dates of birth were collected but not released. To provide calculated ages two variables have been constructed based on complete interview dates and date of birth month/year and 15 as a universal assigned day of birth.</p><p class=\"ql-indent-1\"><br></p><p class=\"ql-indent-1\"><strong>Wave IV Polygenic Scores – Release 2</strong></p><p class=\"ql-indent-1\">Seventy-four constructed polygenic scores (PGSs) are available for Add Health respondents who provided archival saliva samples for genetic testing at Wave IV. Scores are available for various anthropomorphic, health, and behavioral outcomes. See the documentation for a list of all PGSs.</p><p><br></p><p><br></p>', '2020-09-25 23:22:21', '2020-09-25 23:35:53', 4, 'booth'),
