(114, 33, 42, 'P320: Identifying Groups of Policymakers with Similar Communication Prederences to Better Tailor Public Health and Nutrition Related Research Communications', '1', NULL, 1, NULL, 2062, '2020-09-09 02:44:34', '2020-09-30 17:41:37', '471693537.png', '[{\"title\":\"Introduction\",\"text\":\"It is critical that population health research reach decisionmakers. Evidence has suggested that a one-size-fits-all approach is not the right way to communicate, but if we have to tailor, how should we do that? We could  make a separate policy brief for each researcher? Efficiency and effectiveness, audience segmentation\",\"position\":{\"x\":1,\"y\":11,\"ex\":33,\"ey\":99},\"bg\":\"#ffffff\",\"padding\":8,\"zIndex\":0,\"type\":\"text\",\"borderRadius\":8,\"header\":{\"color\":\"#000000\",\"size\":24},\"body\":{\"color\":\"#000000\",\"size\":16,\"bg\":\"#ffffff\",\"borderRadius\":8,\"padding\":8,\"position\":{\"x\":0,\"y\":0,\"ex\":100,\"ey\":100}},\"media\":{\"borderRadius\":8,\"padding\":8,\"bg\":\"#ffffff\",\"position\":{\"x\":0,\"y\":0,\"ex\":100,\"ey\":100},\"file\":\"\"}},{\"title\":\"\",\"text\":\"\",\"position\":{\"x\":1,\"y\":11,\"ex\":33,\"ey\":99},\"bg\":\"#ffffff\",\"padding\":8,\"zIndex\":0,\"type\":\"media\",\"borderRadius\":8,\"header\":{\"color\":\"#000000\",\"size\":24},\"body\":{\"color\":\"#000000\",\"size\":16,\"bg\":\"#ffffff\",\"borderRadius\":8,\"padding\":8,\"position\":{\"x\":0,\"y\":0,\"ex\":100,\"ey\":100}},\"media\":{\"borderRadius\":8,\"padding\":8,\"bg\":\"#ffffff\",\"position\":{\"x\":0,\"y\":0,\"ex\":100,\"ey\":100},\"file\":\"206165899.png\"}}]', '{\"position\":{\"x\":1,\"y\":1,\"ex\":28,\"ey\":10},\"bg\":\"#ffffff\",\"text\":{\"color\":\"#000000\",\"size\":28}}', 'P320', 0),
