(119, 33, 49, 'P284: Individual and neighborhood-level relative income in relation to past-year mental disorders in five cities in Latin America', '1', NULL, 1, '{\"bg\":\"#000000\",\"height\":32,\"btn\":{\"bg\":\"#d683ce\",\"color\":\"#ffffff\",\"radius\":4,\"space\":8,\"boxShadow\":true,\"hasBg\":true,\"fontSize\":13,\"paddingX\":2,\"paddingY\":8}}', 2066, '2020-09-09 02:44:35', '2020-09-30 17:43:29', '455495512.png', '[{\"title\":\"\",\"text\":\"Latin America is a rapidly urbanizing area with high levels of income inequality. \\nNeighborhood-level relative income has been shown to be associated with mental disorders in other regions, but is rarely studied in urban areas of Latin America. \\nOur objective was to assess whether neighborhood-level income was associated with individual past-year mental health disorders in five large cities in Latin America.\",\"position\":{\"x\":1,\"y\":11,\"ex\":33,\"ey\":99},\"bg\":\"#ffffff\",\"padding\":8,\"zIndex\":0,\"type\":\"text\",\"borderRadius\":8,\"header\":{\"color\":\"#000000\",\"size\":24},\"body\":{\"color\":\"#000000\",\"size\":16,\"bg\":\"#ffffff\",\"borderRadius\":8,\"padding\":8,\"position\":{\"x\":0,\"y\":0,\"ex\":100,\"ey\":100}},\"media\":{\"borderRadius\":8,\"padding\":8,\"bg\":\"#ffffff\",\"position\":{\"x\":0,\"y\":0,\"ex\":100,\"ey\":100},\"file\":\"1784865249.pdf\"}},{\"title\":\"\",\"text\":\"Data were from the World Mental Health Survey Initiative in Medell\\u00edn, Colombia; S\\u00e3o Paulo, Brazil; Lima, Peru; Buenos Aires, Argentina; and Mexico City, Mexico (n=7,259 adults). \\nNeighborhood-level relative income was calculated as the ratio between weighted mean neighborhood income and weighted mean city income, then tertiled.\\nOutcomes were grouped into past-year internalizing (mood and anxiety) and externalizing (behavioral and substance use) disorders. \\nWeighted, multivariable, multilevel logistic models were run, adjusting for city, age, sex, individual relative income, education, marital status, employment status, and a random intercept varying at the neighborhood level.\",\"position\":{\"x\":1,\"y\":11,\"ex\":33,\"ey\":99},\"bg\":\"#ffffff\",\"padding\":8,\"zIndex\":0,\"type\":\"text\",\"borderRadius\":8,\"header\":{\"color\":\"#000000\",\"size\":24},\"body\":{\"color\":\"#000000\",\"size\":16,\"bg\":\"#ffffff\",\"borderRadius\":8,\"padding\":8,\"position\":{\"x\":0,\"y\":0,\"ex\":100,\"ey\":100}},\"media\":{\"borderRadius\":8,\"padding\":8,\"bg\":\"#ffffff\",\"position\":{\"x\":0,\"y\":0,\"ex\":100,\"ey\":100},\"file\":\"\"}}]', '{\"position\":{\"x\":1,\"y\":1,\"ex\":99,\"ey\":10},\"bg\":\"#ffffff\",\"text\":{\"color\":\"#000000\",\"size\":36}}', 'P284', 0),
