(122, 33, 40, 'P95: Describing the Populations Depicted in Health Insurance Ads', '1', NULL, 1, '{\"bg\":\"#ffffff\",\"height\":32,\"btn\":{\"bg\":\"#faf9fa\",\"color\":\"#0f0f0f\",\"radius\":4,\"space\":8,\"boxShadow\":true,\"hasBg\":true,\"fontSize\":13,\"paddingX\":2,\"paddingY\":8}}', 2069, '2020-09-09 02:44:36', '2020-09-30 17:44:53', '327076405.png', '[{\"title\":\"Background\",\"text\":\"Media play a complex role in shaping public understanding of health and social policy. Health insurance ads are one form of media that provide information to the public \\nabout health insurance (Fowler, et al, 2017) and subsequently, ideas of who deserves access. Insurance ads include visuals of individuals that may provide cues to the public about the populations currently or potentially benefitting from or deserving of health insurance. In health policy, public programs generally target groups such as the elderly, pregnant women, and children, who are perceived by the public as deserving (Gollust and Lynch, 2011; Schneider and Ingram, 1993) \\nHealth insurance ads are diverse in their objectives and content, though, and these differences motivate analyses of the different populations depicted and how these vary by the type of insurance product that is being marketed. We address these questions in this research:\\n(1) Do the populations depicted in ads differ when comparing ads for Medicaid plans versus non-Medicaid plans? \\n(2) Are ads for Medicaid plans more likely to include depictions of certain population groups deemed deserving of social policy benefits? \",\"position\":{\"x\":\"1\",\"y\":\"12\",\"ex\":33,\"ey\":99},\"bg\":\"#ffffff\",\"padding\":\"8\",\"zIndex\":\"0\",\"type\":\"text\",\"borderRadius\":\"8\",\"header\":{\"color\":\"#000000\",\"size\":\"18\"},\"body\":{\"color\":\"#000000\",\"size\":\"13\",\"bg\":\"#ffffff\",\"borderRadius\":\"-3\",\"padding\":\"5\",\"position\":{\"x\":0,\"y\":0,\"ex\":\"100\",\"ey\":\"93\"}},\"media\":{\"borderRadius\":8,\"padding\":8,\"bg\":\"#ffffff\",\"position\":{\"x\":0,\"y\":0,\"ex\":100,\"ey\":100},\"file\":\"\"}}]', '{\"position\":{\"x\":1,\"y\":1,\"ex\":99,\"ey\":10},\"bg\":\"#ffffff\",\"text\":{\"color\":\"#000000\",\"size\":\"27\"}}', 'P95', 0),
