INSERT INTO `sessions` (`id`, `domain_id`, `event_id`, `category_id`, `track_id`, `title`, `pageType`, `description`, `hashtag`, `presenter`, `url`, `button`, `start`, `end`, `status`, `incoming_stream_name`, `incoming_stream_url`, `zoom_response`, `stream_active`, `stream_url`, `zoom_meeting_id`, `created_at`, `updated_at`, `vimeo_video_id`, `asset`, `upload_type`, `vimeo_link`) VALUES
(53, 33, 6, 11, 2, 'The Toxicity of Structural Discrimination for Population Health: A Focus on Places and Policies', 'Video', 'Discrimination is toxic. A growing body of research illustrates the harmful health consequences of perceived discrimination at the individual-level. However, because many drivers of discrimination occur at the societal or macro level, individuals may not perceive the discrimination they are experiencing. Thus, it is also important to investigate the impact of more diffuse and covert forms of discrimination that are embedded in societal structures and policies. Recent research, most of which is conceptual in nature, suggests that discriminatory ecosocial environments—characterized by various forms of oppression such as racism, sexism and heterosexism—undermine the health of marginalized populations and lead to health disparities across social groups. A key reason for the relative dearth of empirical studies on the impact of structural discrimination on health is that structural discrimination is a complex and insidious de facto phenomenon, making it difficult to measure. Despite the theorized importance of the topic, the scant empirical research in the area has limited our understanding of how place-based discriminatory environments impact population health. \n\nThis interdisciplinary panel will present novel research on how place-based, structural discrimination impacts health. Panelist draw on administrative and policy data on city- and state-level discriminatory environments which are linked with qualitative data and quantitative population-based data sets. Each speaker will present results from their work on the links between discriminatory ecosocial environments and health, and will also discuss broader questions related to how this area of research can contribute to population health science, and the type of data that are necessary to advance this line of research.  ', 'Panel', '[\"tyson.brown@duke.edu\",\"phoman@fsu.edu\",\"cboen@upenn.edu\",\"mp3243@columbia.edu\",\"hedwig.lee@wustl.edu\"]', '/session', 5, '9:00', '10:15', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2020-09-29 01:56:32', '2020-09-30 06:26:05', NULL, NULL, 0, 462839939),
(54, 33, 6, 11, 2, 'Data Innovations for Population Health Research on Health and Cognitive Functioning', 'Video', 'This session features presentations from five projects that are all producing new and innovative survey, biomarker, and/or administrative data for cutting-edge interdisciplinary population health research --- and perhaps especially on cognitive functioning and impairment. The projects include (1) High School and Beyond; (2) the National Longitudinal Study of Adolescent to Adult Health, or Add Health; (3) the Wisconsin Longitudinal Study; (4) the IPUMS-Health Surveys; and (5) the project to link the 1940 U.S. Census to records from HRS, PSID, WLS, NSHAP, and NHATS. Presentations will focus on ongoing/upcoming fieldwork; newly collected or newly available survey, biomarker, and administrative data; and the possibilities for interdisciplinary population health research that are made possible by these data innovations. The presenters are from sociology, public health, and public policy, and the presentations should be of interest to population health scholars from any disciplinary background.', 'Panel ', '[\"warre046@umn.edu\",\"kathie_harris@unc.edu\"]', '/session', 5, '9:00', '10:15', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2020-09-29 01:59:02', '2020-09-30 06:25:51', NULL, NULL, 0, 460270799),
(55, 33, 6, 11, 2, 'Innovative approaches to understanding racial/ethnic and socioeconomic differences in health', 'Video', 'Socioeconomic structures vary tremendously across race due to historic racist policies and practices. Therefore, race and socioeconomic status (SES) are deeply intertwined, fundamental determinants of health. The purpose of this panel is to highlight different methodological approaches that researchers are using to disentangle the effects of race and SES on health. The researchers presenting on this panel have placed great emphasis on the innovative methodological approaches as well as the examination of “non0traditional” SES indicators such as wealth and neighborhood SES effects. Together, these papers will provide a comprehensive look at a new array of research approaches and evidence to improve the understanding of the complex relationship between race, SES and health.', 'Panel', '[\"d.hudson@wustl.edu\",\"sicong.sun@wustl.edu\",\"esposm@umich.edu\",\"tavaresc@lafayette.edu\"]', '/session', 5, '9:00', '10:15', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2020-09-29 02:00:32', '2020-09-30 06:23:45', NULL, NULL, 0, 460368710),
(56, 33, 6, 11, 2, 'Empirically-Derived Place Typologies For Population Health Research and Action', 'Video', 'Increasingly, researchers and policymakers are designing place typologies to understand distributions of place characteristics that influence population health and to inform policy response options. This growth is fueled in part by expanded access to small area data and the availability of new statistical approaches. By identifying how sociodemographic, economic, and population characteristics align across places, typologies can elucidate patterns in what can otherwise be highly complex matrices of disparate data. Typologies thus serve an important descriptive function that enables policymakers in different places to have a common understanding of issues at stake. Characterizing how patterns and trends are associated with improved or worsened health outcomes may also serve to inform policy change opportunities to support improvements in population health, by either spotlighting trends or learning from outliers. At the same time, many users also identify limitations in the use of typologies for prediction purposes.\nIn this panel, speakers will present recent empirical work or works-in-progress to categorize cities or other places into typologies based on essential socioeconomic, population and other characteristics. Speakers will discuss uses and limitations of typologies as tools to inform policy, as well as efforts to assess associations with health and health disparity outcomes.', 'Panel', '[\"ubilal@drexel.edu\"]', '/session', 5, '9:00', '10:15', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2020-09-29 02:01:58', '2020-09-30 06:25:28', NULL, NULL, 0, 460291020),
(57, 33, 6, 11, 2, 'Manufacturing Policies to Improve Vaccination: Are Mandates the Way Forward?', 'Video', 'Recent outbreaks of vaccine preventable diseases such as measles have heightened concern over suboptimal vaccination rates. Undervaccination may be due to access barriers, hesitancy over the safety and effectiveness of vaccination, or both. A variety of strategies exist to encourage greater vaccine uptake, including increasing access to vaccination services, improving vaccine education among youth and parents, providing incentives such as financial bonuses to parents with up-to-date children, and mandating vaccination of schoolchildren without approved exemptions. Child vaccine mandates are ubiquitous in the USA and employed internationally in various ways.\n\nVaccine mandates vary in several key elements, including: target population, what is required, consequences for noncompliance, who is in charge of enforcement, and—perhaps most hotly debated—procedures for exemption. In US states, efforts to remove religious and philosophical exemptions, for example, have become hotly politicized and subject to backlash including protests and ballot measure recall efforts. While the legal and ethical dimensions of such policies are often discussed, conclusions regarding the effectiveness of mandates as a strategy—particularly when they are met with public resistance—remains a thorny issue, as context and implementation factors likely play a substantial role in the success of mandate policies.\n\nThis interactive panel will present a range of evidence-based perspectives on the question: Are mandates the way forward for population vaccine coverage? Panelists from multiple disciplines will describe their research using different approaches to assess the effectiveness of vaccine mandate policies and assert a stance regarding the use of mandates as a policy lever. The moderator will facilitate a lively question and answer session following these presentations, inviting the audience to participate in the dialogue around how to study and implement policy on this challenging topic.\n', 'Panel', '[\"dgreyson@umass.edu\",\"richard.carpiano@ucr.edu\",\"andrea.polonijo@ucr.edu\",\"koltai@uw.edu\"]', '/session', 5, '9:00', '10:15', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2020-09-29 02:02:56', '2020-09-30 06:24:13', NULL, NULL, 0, 460290657),
