(76, 33, 7, 18, 9, 'Race, Place, and Health', 'Video', 'Session Chair: Adam Lippert\nSession Format: Podcast', '', '[\"adam.lippert@gmail.com\",\"aj2476@columbia.edu\",\"rachel_berkowitz@berkeley.edu\",\"jr4048@cumc.columbia.edu\"]', '/session', 5, '9:00', '10:15', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2020-09-29 02:42:36', '2020-09-30 05:15:25', NULL, NULL, 0, 460201960),
(77, 33, 7, 19, 17, 'Population Health Perspectives on Residential Displacement: Examining Gentrification, Affordability, and Evictions', 'Video', 'Although residential displacement appears frequently in contemporary popular discourse, its effects on population health have largely eluded investigation due to challenges in definition and measurement. The people most vulnerable to displacement are often underrepresented in health research and those who become displaced more often disappear into discussions of loss to follow-up rather than prompting further inquiry and action. This panel takes a broad approach to displacement, characterizing it as direct processes (e.g. eviction) and indirect influences (e.g. demographic shifts, gentrification, and housing cost/quality) that obligate a household to move unwillingly from its place of residence. In this session, panelists representing urban planning, social epidemiology, psychology, and medicine will describe a diverse range of strategies to understand the social, structural, and health-related drivers of displacement as well as the impact of displacement on policy-relevant health outcomes.', '', '[\"klchen@mednet.ucla.edu\",\"sil.rgonzalez@ucla.edu\",\"kleifheit@g.ucla.edu\",\"gabelschwartz@gmail.com\",\"hshellae@gmail.com\"]', '/session', 5, '10:30', '11:45', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2020-09-29 02:44:38', '2020-09-30 06:26:49', NULL, NULL, 0, 460274858),
(78, 33, 7, 19, 17, 'The Politics and Policy of Early Childhood: Evidence from Media Framing and Public Opinion about Early Childhood Policy', 'Video', 'Population health researchers agree that policies targeting the early childhood period are critical for improving health and promoting health equity. For instance, research on adverse childhood experiences (ACEs) illuminates that childhood exposure to violence, neglect, substance use and other negative experiences has consequences for health long-term, but that policies that promote family resilience can buffer these consequences. Similarly, population health research supports the importance of investments in early childhood interventions, such as increasing access to affordable and high-quality child care. However, advancing policies targeting early childhood requires research attention not only to policies and their likely effectiveness, but also to the political factors that contribute to policy implementation. Each of the authors on this panel will present new data on two such factors: media coverage and public opinion. While some of the authors on the panel are collaborators on the projects described, they each bring different disciplinary perspectives (public health, public policy, political science, communication).\nThe panel will be moderated by Dr. Sarah Gollust (University of Minnesota). Dr. Gollust will introduce the panel with a discussion of why attention to media and public opinion are critical to understanding the policymaking process. In doing so, she will present data from a study on media coverage of ACEs. Next, Margaret Tait (University of Minnesota) will present data from a study on local TV news coverage of early childhood education and care. Then, Dr. Purtle (Drexel) will present new nationally-representative data on the levels of stigma the public holds toward people who have experienced ACEs. He will demonstrate that stigma and blame are important contributors to the public’s assessment of the importance of policy action. Finally, Dr. Niederdeppe (Cornell) will present results from a longitudinal messaging experiment examining the effectiveness of evidence-based communication strategies in promoting public support for state policies to promote accessible and high-quality child care. The panel will then discuss common themes and opportunities to advance public attention to policies surrounding early childhood.', '', '[\"sgollust@umn.edu\",\"jdn56@cornell.edu\",\"tait0013@umn.edu\"]', '/session', 5, '10:30', '11:45', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2020-09-29 02:45:55', '2020-09-30 06:27:16', NULL, NULL, 0, 460499949),
(79, 33, 7, 19, 17, 'Federal Housing Policy as Public Health Policy: Evaluating the Choice Neighborhood Initiative', 'Video', 'The US Department of Housing and Urban Development (HUD) Choice Neighborhood Initiative (CNI) aims to improve living conditions and health outcomes for vulnerable populations through integrated investments in people, housing, and neighborhoods. Leveraging public and private dollars, CNI supports efforts that bring local leaders, residents, and stakeholders together to transform neighborhoods with distressed public or HUD-assisted housing by catalyzing critical improvements to vacant properties, housing, businesses, services, and schools. The CNI policy initiatives are fundamentally transforming the places in which low-income residents live, affecting a wide range of social determinants of health. Furthermore, the CNI emphasis on public-private partnerships and mixed-income housing introduces complicated questions around the ability of profit-motivated private sector actors to deliver health-promoting services to low-income community members.\nTotal government investment in CNI initiatives totals more than one billion dollars since the program’s inception in 2011. The first five implementation grantees spanned the country, including the Quincy Corridor neighborhood in Boston, the Woodlawn neighborhood in Chicago, the Iberville/Tremé neighborhood in New Orleans, the Eastern Bayview neighborhood in San Francisco, and the Yesler neighborhood in Seattle. Subsequent waves of implementation grants have covered 25 additional cities, with many more in the planning phase. Given the scale of this policy, the need for strong and accountable science assessing these programs’ impacts is high. In this panel, we will present on efforts to address this need through interdisciplinary, community-engaged, policy-relevant research initiatives.', '', '[\"katherine.dickinson@cuanschutz.edu\",\"jeremy.auerbach@colostate.edu\",\"leah.m.lozier@hud.gov\"]', '/session', 5, '10:30', '11:45', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2020-09-29 02:47:11', '2020-09-30 06:26:19', NULL, NULL, 0, 460333838),
(80, 33, 7, 19, 17, 'Producing Populations: History and Public Health in the Latinx community', 'Video', 'Our panel seeks to bring forth interdisciplinary discussions at the intersections of public health, history, and Latina/o/x communities. We want to explicitly link events and movements in US Latinx history to current public health issues. For this panel, experts in Latinx history and public health are paired to discuss ways in which historical events set precedence and foundations for continued and ongoing disparities in health for generations of Latinx. As such, we hope to bridge a massive intellectual and disciplinary divide between the humanities and social sciences at a time when cross-pollination is sorely needed to address health disparities for historically marginalized and racialized communities in the United States.', '', '[\"jdaul@uw.edu\",\"nicole-novak@uiowa.edu\"]', '/session', 5, '10:30', '11:45', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2020-09-29 02:48:14', '2020-09-30 06:26:32', NULL, NULL, 0, 460290807),
(81, 33, 7, 19, 17, 'Challenging Place and Power: A Discussion of Participatory Research Methods to Transform Local Political Economies of Health', 'Video', 'Political economies of health are not only national in scale; they are reproduced at the local level. Policies and practices, created and enforced by local government entities, determine who is welcomed, who is counted, and who holds power. This session draws on the coupled disciplines of urban planning and social work - two fields tasked with protecting local community-level health and well-being - to examine how who is welcomed, who is counted, and who holds power determines health outcomes. These themes will be supported with case examples of feminist neighborhood political\necology, changing political units, and place-based power dynamics that prevent communities from attaining full health and well-being. Panelists will incorporate diverse jurisdictional and geographical boundaries to explore how these themes\npresent in cities, suburbs, unincorporated territories, borders, and rural areas across the US.\n\nThis interactive session will feature researchers who are countering traditional boundaries of place and power through innovative methods and approaches to meet the needs of rural and urban communities. The first segment of the panel\nwill focus on a discussion of participatory methods that confront local power dynamics, bring visibility to uncounted populations, and reverse political and social exclusion. Each researcher will share their story and experience utilizing participatory research methodologies within and outside the fields of social work and planning. In the second segment of the presentation, panelists will conclude with a reflection on the potential for greater municipal level cross-sector partnerships to achieve a culture of health and engage the audience in a discussion related to place and power with the\ngoal of reflecting on cross-disciplinary experiences.', '', '[\"pcw04@my.fsu.edu\",\"moni.gutierrez@asu.edu\",\"cgomezvidal@berkeley.edu\"]', '/session', 5, '10:30', '11:45', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2020-09-29 02:49:36', '2020-09-30 06:27:07', NULL, NULL, 0, 460303564),
(82, 33, 7, 20, 10, 'Effective social media use and online platforms for interdisciplinary scholars', 'Video', 'The IAPHS Student Committee is pleased to be continuing its new three-part training series “Launching a Career as an Interdisciplinary Scholar: A Training Series” during the 2020 virtual conference event. As a collaborative, cross-disciplinary population health organization, IAPHS is uniquely positioned to guide the next generation of population health scholars. The organization’s leadership and members bring a wealth of knowledge and training based on their graduate school experiences, post-graduate professional appointments, and current roles as mentors and supervisors. These experiences provide key insight into the methodological skills, substantive knowledge bases, and professional activities that are most valuable to the development of excellent population health scholars. Furthermore, these diverse experiences provide key insights into the nuances of navigating career paths and opportunities in population health.  \n\nEffective social media use and online platforms for interdisciplinary scholars” – will focus on how interdisciplinary scholars can use social media and other digital platforms (e.g., Twitter, blogs, LinkedIn, podcasts) to enhance the reach and impact of their work.\n', '', '[\"ml3440@cumc.columbia.edu\",\"raeannem@live.unc.edu\",\"richard.carpiano@ucr.edu\"]', '/session', 5, '12:00', '13:00', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2020-09-29 02:51:47', '2020-09-30 06:27:28', NULL, NULL, 0, 462862865),
