(92, 33, 8, 25, 15, 'Interdisciplinary Perspectives and Methods for Studying Place, Identity and Maternal Health', 'Video', 'Our mixed-methods panel will discuss the intersection of maternal health outcomes, identity, and place, by showcasing both population and community-based research with a focus on underserved communities, such as immigrant mothers, racial/ethnic minority women or those living in rural areas. The panel will consist of four presentations from an interdisciplinary set of health researchers (Nicole L. Novak, Jaime C. Slaughter-Acey, Cristin E. McArdle, and William T. Story). As such each presentation will provide a different window into the study of maternal health-relevant exposures, outcomes and interventions, which span the life course from preconception and individual birth outcomes, to a woman’s full reproductive history. We will present and discuss novel approaches to studying maternal health, pregnancy and access to care that include community-based in-depth interviews, maternally-linked longitudinal analyses, and community-centered interventions designed to address the needs of women in the most underserved communities.', '', '[\"fernandez-rhodes@psu.edu\",\"nicole-novak@uiowa.edu\",\"jslaught@umn.edu\",\"cem5997@psu.edu\",\"william-story@uiowa.edu\"]', '/session', 5, '10:45', '12:00', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2020-09-29 03:04:02', '2020-09-30 06:28:51', NULL, NULL, 0, 460501760),
(93, 33, 8, 25, 15, 'Opportunities and Challenges using Data on Mortality Disparities in American Communities', 'Video', 'The American Communities Survey in 2008 has been linked to the National Death Index through 2015, creating the Mortality Disparities in American Communities (MDAC) data resource. Further enrichment through linkage to area-level characteristics allows for exploration of how local retail amenities (e.g., walkable destinations) or hazards (e.g., alcohol, tobacco outlets) affect cardiometabolic, injury, and all-cause mortality. Retail data for census tracts and postal codes have been estimated using data from the National Establishment Time Series. Detailed personal and household data can be used to address potential confounding, explore mediators such as active transportation, or spotlight socioeconomic disparities. This panel will include an introduction to the origin and construction of the MDAC data, followed by 3 presentations illustrating research applications with the MDAC data. Each 15-min presentation will be followed by 5 minutes for Q&A, concluding with 5-10 minutes for integrative discussion and distribution of an information sheet on options and procedures to access MDAC data.', '', '[\"daq26@drexel.edu\",\"jrb436@drexel.edu\",\"ubilal@drexel.edu\",\"tlb356@drexel.edu\"]', '/session', 5, '10:45', '12:00', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2020-09-29 03:04:55', '2020-09-30 06:28:18', NULL, NULL, 0, 460261547),
(94, 33, 8, 25, 15, 'Policy surveillance and policy evaluation to promote urban health: Lessons from Latin America and the United States', 'Video', 'Developing and implementing urban policy to achieve desired health outcomes requires an understanding of the complex ways urban policies and interventions influence behavior in different contexts. At the same time, designing and implementing comprehensive policy evaluation processes for diverse contexts presents many challenges and requires the collaboration of multiple sectors and disciplines.\n\nThis panel will discuss approaches to policy surveillance and to evaluating the impacts of urban policies on health outcomes, along with the challenges and opportunities associated with each strategy. Examples will focus on subnational policies across the US and in Latin American cities. Presenters will discuss a study evaluating the impact of road safety policy change in Mexico; national and subnational alcohol policy surveillance in Latin America; sub-national policy responses to the opioid epidemic in the United States; and the use of agent-based models to predict the potential impact of policy implementation on behavior and health.\n\nEach approach presents its own set of strengths and limitations and provides valuable insight for urban policy development and implementation and for future policy evaluation processes.\n', '', '[\"kbi24@drexel.edu\",\"daq26@drexel.edu\",\"phm32@drexel.edu\",\"bal95@drexel.edu\"]', '/session', 5, '10:45', '12:00', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2020-09-29 03:05:53', '2020-09-30 06:28:40', NULL, NULL, 0, 460327092),
(95, 33, 8, 25, 15, 'Critiques of Western Paternalism on Global Health Outcomes', 'Video', 'At its core, the field of global health strives to create more equitable relationships between people and places around the world. However, the contemporary global health discourse lacks critical consideration of the historical background, political context, and disproportionate power dynamics of the current, Western-dominated system. Nearly every aspect of global health from agenda-setting to financing, funding, data collection, publishing, and research dissemination is dominated by the Global North. For example, of the 198 global health organizations around the world, less than 15% are located outside of North America or Western Europe (Global Health 50/50, 2019). Also, a number of recent studies have highlighted the fact that African researchers are under-represented in first and last authorship positions in papers published from research conducted in Africa (Mbaye et al., 2019; Hedt-Gauthier et al., 2019). This discussion brings together researchers, policymakers, and others interested in identifying and correcting some of the pervasive power imbalances in global health that contribute to these inequities. By critically engaging with the shortcomings of our current global health system, we demonstrate how we can work across disciplines towards more equitable global health practice. First, we discuss how policies that are meant to improve public health can exacerbate global inequities by not accounting for the priorities and expertise of local communities. Next, we present results from qualitative interviews with healthcare professionals who deployed to the 2014–2016 West Africa Ebola epidemic to illustrate the harms that can arise as a result of relying on a Western-centric approach to healthcare volunteerism. Then, we examine ongoing trends in persistent colonization of global health that still exist through informal venues such as foreign policy. Finally, we address the extent to which accessibility of data on underserved populations can lead to further exploitation and stigmatization, and the limitations of “informed consent” in these contexts. We incorporate both research and professional experiences to inform this conversation, and will close with a moderated discussion including a synthesis of our presentations, actionable ways to decolonize global health, and strategies to overcome systemic barriers that may impede that goal. This discussion highlights the importance and challenges of cross-cultural collaborations, and lessons learned that can inform true collaborative transnational partnerships and effective global health research, practice, and policy.', '', '[\"agoheer1@jhu.edu\",\"denise.st.jean@unc.edu\",\"enwankwo@ucla.edu\",\"ansirfan@gwu.edu\",\"cwoko@upenn.edu\"]', '/session', 5, '10:45', '12:00', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2020-09-29 03:06:46', '2020-09-30 06:27:47', NULL, NULL, 0, 460290556),
(96, 33, 8, 13, 4, 'Moving Beyond Lip Service: IAPHS’s Initial Conversation on Racial and Social Justice in America', 'Video', 'As this public health crisis unfolds in the U.S., it is making even more visible the interlocking systems of racism and marginalization that have their origins in the genocide of Native American peoples and enslavement of African peoples, which together constitute the foundation upon which the nation was built. While COVID-19 is indiscriminate in its transmission, its propagation within this society steeped in structural racism has led to disproportionate impacts among marginalized racial groups in this country. This is not an isolated event; racism is a major driver of social determinants of health and health inequities. Structural racism refers to the totality of ways in which societies foster racial discrimination, via mutually reinforcing inequitable systems that, in turn, reinforce discriminatory beliefs, values, and distribution of resources, reflected in history, culture, and interconnected institutions. Interdisciplinary – if not transdisciplinary – research is necessary to operationalize the population health impacts of structural racism as well as identify the most effective leverage points to achieve racial equity in health. \nThe purpose of this session is to have an initial conversation on how we, as IAPHS members, can ensure that IAPHS is diverse, inclusive, anti-oppressive, anti-racist, and equitable, and how we, as IAPHS members, can take action to inform population health researchers and the broader community about structural racism (especially anti-Black racism) and steps to dismantle it. From this session, the leaders would like to create a working group (tentatively: IAPHS Racial And Social Justice Working Group) to prioritize our work for the upcoming years.  ', '', '[\"zbailey@miami.edu\",\"rthorpe@jhu.edu\"]', '/session', 5, '12:00', '13:00', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2020-09-29 03:08:37', '2020-09-30 06:28:29', NULL, NULL, 0, 462861974),
(97, 33, 8, 26, 16, 'Corporations and Population Health', 'Video', 'Session Moderator: Fred Zimmerman', '', '[\"frederick.zimmerman@gmail.com\",\"Nick.Freudenberg@sph.cuny.edu\",\"greenhalgh@fas.harvard.edu\"]', '/session', 5, '13:00', '14:15', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2020-09-29 03:10:05', '2020-09-30 05:14:32', NULL, NULL, 0, 460510749),
(98, 33, 8, 22, 12, 'State Preemption Laws and Public Health', 'Video', 'Many US states have recently removed local government authority to legislate on issues that benefit public health, such as raising the minimum wage or taxing soda. This growing tide of state preemption laws has been brought out of the shadows during COVID-19, as some states banned localities from implementing stay-at-home orders or mandating masks. This panel will discuss the preemption movement and its threat to public health. It features four energetic activists with a long history of making positive policy changes. Kim Haddow, Director of the Local Solutions Support Center, will discuss the origins of the movement and its industry supporters. Eric Batch, VP of Advocacy for the American Heart Association (AHA), will discuss his experiences in combating preemption across West Coast states. Chokwe Antar Lumumba, the Mayor of Jackson Mississippi, will share his experiences with preemption and offer advice to researchers and advocates concerned about the public health implications. Christine Compton, Policy Engagement Manager for AHA will explain what kinds of data and research that advocates need to bring to legislators.', '', '[\"jmontez@maxwell.syr.edu\"]', '/session', 5, '14:30', '15:45', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2020-09-29 03:11:10', '2020-09-30 06:28:08', NULL, NULL, 0, 462862319);
